(44, 'public class Questao_3 {\n\n    public static void main(String[] args) {\n\n        int codigoProduto;\n        String classificacao;\n\n        try {\n            codigoProduto = Integer.parseInt(JOptionPane.showInputDialog(\"Digite um código:\"));\n\n            if (codigoProduto == 1) {\n                classificacao = \"Alimento não-perecível\";\n            } else if (codigoProduto == 2 || codigoProduto == 3 || codigoProduto == 4) {\n                classificacao = \"Alimento perecível\";\n            } else if (codigoProduto == 5 || codigoProduto == 6) {\n                classificacao = \"Vestuário\";\n            } else if (codigoProduto == 7) {\n                classificacao = \"Higiene pessoal\";\n            } else if (codigoProduto >= 8 && codigoProduto <= 15) {\n                classificacao = \"Limpeza e utensílios domésticos\";\n            } else {\n                classificacao = \"Inválido\";\n            }\n\n            JOptionPane.showMessageDialog(null, classificacao);\n        } catch (Exception e) {\n            JOptionPane.showMessageDialog(null, e.getMessage());\n        }\n\n    }', '1542242939', 1, 'text', '', 1),
